    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + 32 * - + col1 + - 11 / + col2 - - + 95 - - + col1 + - 46 * - + col2 IS NULL;
  - name: tab2

outputs:
  - name: q6590.out
    data: |
      46	51	23
      64	77	40
      75	67	58
